import React from 'react';
import Search from '../components/Search';
import Carousel from '../components/Carousel';
import ProductSection from '../components/ProductSection';

const HomePage = () => {
  return (
    <div>
      <Search />
      <Carousel />
      <ProductSection />
    </div>
  );
};

export default HomePage
